import { useState } from "react";
import "./pomodoro.css";
// import React, { useState, useEffect } from "react";

function Pomodoro() {
  let [stopwatch, setStopwatch] = useState(10000);

  function StopwatchStart() {
    if (stopwatch <= 0) {
      alert("koniec");
    }
    return <div>{stopwatch}</div>;
  }
  return (
    <div className="Pomodoro">
      <div className="pomodoroCounter">{stopwatch}</div>
      <button className="pomodoroButton">START</button>
    </div>
  );
}

export default Pomodoro;
